import { classService } from '../_services/class.service';

export const getRooms = () => {
  return dispatch => {
    let apiEndpoint = `/rooms?access_token=${localStorage.token}`;
    classService.get(apiEndpoint)
      .then((response) => {
         dispatch({
          type: "FETECHED_ALL_ROOMS",
          payload: response.data,
        })
      }).catch((err) => {
      })
  };
}
